import './App.css';

import NavBar from "./components/NavBar/NavBar"

function App() {
  return (
    <div className="App">
      <NavBar>
      </NavBar>
      <h2>Cards</h2>
      <p>The box-shadow property can be used to create paper-like cards:</p>

      <div class="card">
        <div class="header">
          <h1>1</h1>
        </div>

        <div class="container">
          <p>January 1, 2016</p>
        </div>
      </div>
    </div>
  );
}

export default App;
